import React, { useState, Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import logo from "./logo.svg";

import "./App.css";

function Head(props) {
  var [navBar, setPos] = useState(false);

  function onScreenLoad() {
    alert("hey");
  }
  var setValue = 0;
  // if(setValue === 0){
  //   document.getElementById("menu").style.display = "none";

  // }
  function menuNavBar() {
    setValue = 1;
    if (navBar === false) {
      document.getElementById("menu").style.display = "initial";

      setPos(true);
    } else {
      document.getElementById("menu").style.display = "none";

      // document.getElementById("menu").style.height = "2";

      setPos(false);
    }
  }

  return (
    <div onload={onScreenLoad}>
      <div className="header-bar" style={{position:"fixed"}}>
        <header>
          {/* <div className="logo"><span className="logo1">Young</span><span className="logo2">Accelerate</span></div> */}
          <div className="logo"><img src={logo}/></div>
          <div className="hd-col">
            <Link to="/" className="hd">
              HOME
            </Link>

            <Link to="/about/" className="hd" onClick={()=> window.scrollTo(0, 630)}>
              ABOUT
            </Link>

            <Link to="/contact/" className="hd" onClick={() =>  window.scrollTo(0, 1200)}>
              CONTACT US
            </Link>

            <Link to="/applications/" className="hd">
              APPLICATIONS
            </Link>
          </div>
          <div className="hamburg" onClick={menuNavBar}>
            MENU
          </div>
        </header>

        <div className="menu" id="menu">
          <div className="navbar" id="navbar">
            <hr />
            <Link to="/" className="hdm home">
              HOME
            </Link>
            <hr />

            <Link to="/aboutus/" className="hdm">
              ABOUT
            </Link>
            <hr />

            <Link to="/contact/" className="hdm">
              CONTACT US
            </Link>
            <hr />

            <Link to="/applications/" className="hdm">
              APPLICATIONS
            </Link>
            <hr />
            {/* <Link to="/signin" className="hdm">SIGNIN</Link>
            <hr /> */}
          </div>

        </div>
      </div>
    </div>
  );
}

export default Head;
